import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import ListUserComponent from './components/ListUserComponent';
import HeaderComponent from './components/HeaderComponent';
import FooterComponent from './components/FooterComponent';
import CreateUserComponent from './components/CreateUserComponent';
import ViewUserComponent from './components/ViewUserComponent';
import UpdateUserComponent from './components/UpdateUserComponent';


const App = () => {
  return (
        <Router>
              <HeaderComponent />
                <div className="container">
                    <Routes> 
                          <Route path = "/" element= {<ListUserComponent />}></Route>
                          <Route path = "/add-task" element= {<CreateUserComponent/>}></Route>
                          <Route path = "/list/all" element = {<ViewUserComponent/>}></Route>
                          <Route path = "/update/taskStatus" element = {<UpdateUserComponent/>}></Route>
                    </Routes>

                </div>
              <FooterComponent />
        </Router>

    );
  }
